const API_URL = 'https://api-finanzas-vk8w.onrender.com/api';

let productos = [];
let productosSeleccionados = [];

document.addEventListener('DOMContentLoaded', async () => {
  await cargarProductos();
});

async function cargarProductos() {
  try {
    const res = await fetch(`${API_URL}/productos`);
    const data = await res.json();
    productos = data.data || data;
  } catch (err) {
    console.error('Error al cargar productos:', err);
  }
}

function buscarProducto() {
  const termino = document.getElementById('busqueda').value.toLowerCase();
  const resultados = document.getElementById('resultados');
  resultados.innerHTML = '';

  if (termino.length === 0) return;

  const filtrados = productos.filter(p => p.nombre.toLowerCase().includes(termino));

  if (filtrados.length === 0) {
    const li = document.createElement('li');
    li.textContent = `‚ûï Agregar "${termino}" como nuevo producto`;
    li.style.fontStyle = 'italic';
    li.style.color = '#007bff';
    li.style.cursor = 'pointer';
    li.onclick = () => mostrarModalAgregarProducto(termino);
    resultados.appendChild(li);
    return;
  }

  filtrados.forEach(prod => {
    const li = document.createElement('li');
    li.textContent = `${prod.nombre} - $${prod.precioUnitario}`;
    li.onclick = () => seleccionarProducto(prod);
    resultados.appendChild(li);
  });
}


function seleccionarProducto(producto) {
  const productoExistente = productosSeleccionados.find(p => p._id === producto._id);

  if (productoExistente) {
    productoExistente.cantidad++;
  } else {
    productosSeleccionados.push({ ...producto, cantidad: 1 });
  }

  document.getElementById('busqueda').value = '';
  document.getElementById('resultados').innerHTML = '';
  renderizarTabla();
}

function renderizarTabla() {
  const tabla = document.getElementById('tablaProductos');
  tabla.innerHTML = '';

  productosSeleccionados.forEach((prod, index) => {
    const fila = document.createElement('tr');

    fila.innerHTML = `
      <td>${prod.nombre}</td>
      <td>$${prod.precioUnitario}</td>
      <td><input type="number" min="1" value="${prod.cantidad}" onchange="actualizarCantidad(${index}, this.value)" /></td>
      <td>$${prod.precioUnitario * prod.cantidad}</td>
    `;

    tabla.appendChild(fila);
  });

  actualizarTotales();
}

function actualizarCantidad(index, valor) {
  productosSeleccionados[index].cantidad = parseInt(valor);
  renderizarTabla();
}

function actualizarTotales() {
  const total = productosSeleccionados.reduce((sum, p) => sum + (p.precioUnitario * p.cantidad), 0);
  const abono = parseFloat(document.getElementById('abono').value) || 0;
  const saldo = total - abono;

  document.getElementById('total').textContent = total.toFixed(2);
  document.getElementById('saldo').textContent = saldo.toFixed(2);
}

async function guardarFactura() {
  const cliente = document.getElementById('cliente').value.trim();
  const abono = parseFloat(document.getElementById('abono').value) || 0;
  const total = productosSeleccionados.reduce((sum, p) => sum + (p.precioUnitario * p.cantidad), 0);
  const saldo = total - abono;

  if (!cliente || productosSeleccionados.length === 0) {
    alert('Por favor completa el cliente y selecciona productos.');
    return;
  }

  const productosFactura = productosSeleccionados.map(p => ({
    _id: p._id,
    nombre: p.nombre,
    precioUnitario: p.precioUnitario,
    cantidad: p.cantidad,
    total: p.precioUnitario * p.cantidad
  }));

  const factura = {
    cliente,
    productos: productosFactura,
    abono,
    total,
    saldo,
    fecha: new Date().toISOString()
  };

  try {
    const res = await fetch(`${API_URL}/facturas`, {
      method: 'POST',
      headers: { 'Content-Type': 'application/json' },
      body: JSON.stringify(factura)
    });

    if (res.ok) {
      alert('Factura guardada correctamente');
      generarPDF(factura); // üßæ Genera el PDF
      window.location.reload();
    } else {
      const error = await res.json();
      console.error('Error al guardar:', error);
      alert('Hubo un error al guardar la factura');
    }
  } catch (err) {
    console.error('Error de conexi√≥n:', err);
    alert('Error de conexi√≥n al guardar la factura');
  }
}

async function generarPDF(factura) {
  const { jsPDF } = window.jspdf;
  const doc = new jsPDF();

  const logoBase64 = 'data:image/png;base64,'; // Aqu√≠ va tu imagen convertida

  // Estilo encabezado
  doc.setFontSize(18);
  doc.setTextColor(34, 139, 34);
  doc.text('"JohAn" Arte Manual', 105, 20, { align: 'center' });

  // Logo
  doc.addImage(logoBase64, 'PNG', 130, 10, 80, 80);

  // Informaci√≥n del cliente
  doc.setFontSize(12);
  doc.setTextColor(80, 80, 80);
  doc.text(`Cliente: ${factura.cliente}`, 15, 40);
  doc.text(`Fecha: ${new Date().toLocaleString()}`, 15, 48);
  doc.text(`Abono: $${factura.abono}`, 15, 56);
  doc.text(`Total: $${factura.total}`, 15, 64);
  doc.text(`Saldo: $${factura.total - factura.abono}`, 15, 72);

  // Tabla de productos
  const productosData = factura.productos.map(p => [
    p.nombre,
    `$${p.precioUnitario}`,
    p.cantidad,
    `$${p.precioUnitario * p.cantidad}`
  ]);

  doc.autoTable({
    startY: 80,
    head: [['Producto', 'Precio Unitario', 'Cantidad', 'Total']],
    body: productosData,
    theme: 'grid',
    headStyles: {
      fillColor: [46, 125, 50], // Verde profesional
      textColor: [255, 255, 255],
      fontStyle: 'bold',
    },
    bodyStyles: {
      textColor: [50, 50, 50]
    },
    styles: {
      fontSize: 10,
      cellPadding: 3,
    },
    columnStyles: {
      3: { halign: 'right' } // Alinear a la derecha la columna Total
    }
  });

  doc.save(`factura_${factura.cliente}.pdf`);
}

function mostrarModalAgregarProducto(nombre) {
  document.getElementById('nuevo-nombre').value = nombre;
  document.getElementById('nuevo-precio').value = '';
  document.getElementById('modalAgregarProducto').style.display = 'block';
}

function cerrarModalAgregarProducto() {
  document.getElementById('modalAgregarProducto').style.display = 'none';
}

function guardarNuevoProducto() {
  const nombre = document.getElementById('nuevo-nombre').value.trim();
  const precio = parseFloat(document.getElementById('nuevo-precio').value);

  if (!nombre || isNaN(precio) || precio <= 0) {
    alert('Por favor, ingresa un precio v√°lido.');
    return;
  }

  const nuevoProducto = { nombre, precioUnitario: precio };

  fetch(`${API_URL}/productos`, {
    method: 'POST',
    headers: { 'Content-Type': 'application/json' },
    body: JSON.stringify(nuevoProducto)
  })
    .then(res => res.json())
    .then(data => {
      productos.push(data); // actualiza la lista local
      seleccionarProducto(data); // selecciona directamente
      cerrarModalAgregarProducto();
      alert('Producto agregado exitosamente');
    })
    .catch(err => {
      console.error('Error al agregar producto:', err);
      alert('Error al guardar el producto');
    });
}


